(104, 'Aristocrat Air Pro Trolley Bag Set of 2 Polypropylene Spinner Wheels Hard Luggage (55Cm and 66Cm) ', '<ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); padding: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">TOUGH AND DURABLE :This lightweight, durable and scratch-resistant luggage ensures sturdiness, water resistance, and impact resilience.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">EASY TO MOVE:This stylish yet strong trolley bag features adequate storage space for your belongingss, smooth 360 degree dual wheels and an adjustable trolley handle to let you travel with comfort.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">ENHANCED SECURITY: Featuring a secured combination lock and secure zipper to keep your stuff secure as you go out on new adventures.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">SPACIOUS: Pack more with spacious multi compartments, full fabric convipack and compression straps which help save space.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">WARRANTY:This luggage comes with a 7-years warranty against manufacturer faults. It is built in our manufacturing plant and has passed extensive quality testing to ensure that your trips are hassle-free.</span></li></ul>', '<div>Aristocrat Air Pro Trolley Bag Set of 2</div><div>Polypropylene Spinner Wheels Hard Luggage (55Cm and 66Cm)&nbsp;</div><div>Cabin and Medium Check-in Luggage</div><div>Secured Combination Lock</div><div>Cross Teal&nbsp;</div><div>Unisex</div>', 54, 15, 17500, 2999, 6, 0, 'https://amzn.to/4gF7Mem', 'Aristocrat Air Pro Trolley Bag Set of 2 Polypropylene Spinner Wheels Hard Luggage', 'Aristocrat Air Pro Trolley Bag,  Trolley Bag, discount shopping, hot shopping deals', 'Aristocrat Air Pro Trolley Bag Set of 2 Polypropylene Spinner Wheels Hard Luggage', 109, '2024-09-18 05:24:25', '2024-09-25 06:38:22', NULL);
