(122, 'SHAYONAM Microfiber Feather Duster Bendable & Extendable Fan Cleaning Duster with 100 inches Expandable Pole', '<h1 class=\"a-size-base-plus a-text-bold\" style=\"padding: 0px 0px 4px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-weight: 700 !important; font-size: 16px !important; line-height: 24px !important;\">About this item</h1><ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); padding: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Extendable Long Pole With high quality 100 inch long stainless steel telescopic pole you dont need to take risks cleaning the high areas anymore just use this duster for cleaning and extend the length of duster pole from 30 to 100 inches to clean the dust easily.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Bendable Head The wire built into the cleaning duster head is sturdy and bendable up to . The duster head can be bent into various angles you want cleaning all kinds of dead angles and hard to reach areas. Its a good helper for housework. And the duster is installed with a unique Soft Rubber Tip at the top to ensure you can clean the dust with complete peace of mind.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Make Housework Easier Featuring innovative split fiber technology the duster becomes electrostatically charged as you use it attracting dust and hairs with ease. Use it wet or dry to get your house spick and span. Light weight, sturdy and durable Microfiber Feather Duster can be used for household appliances ceiling window blinds, ceiling fans various furniture and cars.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Washable Detachable How to clean up the duster. It couldnt be simpler. Just slide the head off the telescopic wand hand washes it with warm or low heat water Rotate the pole and let the microfiber be fluffy. Then place it in ventilated place to dry. We have also designed the base of the extending rod with a hanging hole to make it storage friendly</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Duster Easy to Clean. Want to clean the hypoallergenic duster It couldnt be simpler. Just slide the head off the telescopic wand hand wash with warm or low heat water! Rotate the pole let the microfiber be fluffy. Place in ventilated place to dry. We have also designed the base of the extending rod with a hanging hole to make storage very space friendly</span></li></ul>', '<p>SHAYONAM Microfiber Feather Duster Bendable &amp; Extendable Fan Cleaning Duster with 100 inches Expandable Pole Handle Washable Duster for High Ceiling Fans,Window Blinds, Furniture (Gray)</p><table class=\"a-normal a-spacing-micro\" style=\"width: 453.962px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px; margin-bottom: 0px !important;\"><tbody><tr class=\"a-spacing-small po-brand\" style=\"margin-bottom: 8px !important;\"><td class=\"a-span3\" style=\"vertical-align: top; padding-top: 0px; padding-bottom: 3px; padding-left: 0px; margin-right: 0px; width: 118.838px; float: none !important;\"><span class=\"a-size-base a-text-bold\" style=\"font-weight: 700 !important; line-height: 20px !important;\">Brand</span></td><td class=\"a-span9\" style=\"vertical-align: top; padding-top: 0px; padding-right: 0px; padding-botto