(127, 'QUBO 10A Wifi + BT Smart Plug from Hero Group, Energy Monitoring, Suitable for small devices like TVs, Air Purifiers', '<h1 class=\"a-size-base-plus a-text-bold\" style=\"padding: 0px 0px 4px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-weight: 700 !important; font-size: 16px !important; line-height: 24px !important;\">About this item</h1><ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); padding: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Compatible with light appliances like TVs, kettles, table fans, lamps, air purifier etc. With remote control through voice and app control you can control them conveniently using your phone or google assistant and alexa devices to switch on/off, or to set schedules and timers on them.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Energy Consumption Monitoring - Manage, track and conserve energy consumption of appliances efficiently with access to real time power monitoring.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Scheduler - Use the app to create customized schedules to automate your daily activities. Like schedule to switch on the air purifier to turn on at 8pm every night in the bedroom and switch off at 7:30am.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Timer - No more panic. Never forget to switch off an appliance again by setting up a smart timer on them. You can conserve energy or also protect your devices from overcharging like in the case of phone and laptop chargers.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Safety - In case, you are also someone who forgets if they have switched off a device or not, one can connect it to a plug and also remotely turn off a device. Save your high energy bills and your house from unprecedented damage.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Sharing &amp; Grouping - Multi-person control of one device. And multiple devices can be grouped.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Voice Control compatibility - It works with Alexa and Google assistant devices. Simply make a voice command to control devices without having to physically interact with them.</span></li></ul>', '<p>QUBO 10A Wifi + BT Smart Plug from Hero Group, Energy Monitoring, Suitable for small devices like TVs, Air Purifiers, Mobile &amp; Laptop Chargers (Voice Control with Amazon Alexa and Google Assistant)</p><table class=\"a-normal a-spacing-micro\" style=\"width: 453.962px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px; margin-bottom: 0px !important;\"><tbody><tr class=\"a-spacing-small po-brand\" style=\"margin-bottom: 8px !important;\"><td class=\"a-span3\" style=\"vertical-align: top; padding-top: 0px; padding-bottom: 3px; padding-left: 0px; margin-right: 0px; width: 118.838px; float: none !important;\"><span class=\"a-size-base a-text-bold\" style=\"font-weight: 700 !important; line-height: 20px !important;\">Brand</span></td><td class=\"a-span9\" style=\"vertical-align: top; padding-top: 0px; padding-right: 0px; padding-bottom: 3px; margin-right: 0px; width: 335.125px; float: none