(133, 'KODAK Special Edition 108 cm (43 inch) Full HD LED Smart Linux TV 2024 Edition with 30W Sound Output & Bezel-Less Design  (43SE5004BL)', '<div class=\"_9GQWrZ\" style=\"margin: 0px; padding: 0px 0px 10px; color: rgb(33, 33, 33); font-size: 20px; font-family: Inter, -apple-system, Helvetica, Arial, sans-serif;\">Stunning Visuals</div><div class=\"AoD2-N\" style=\"margin: 0px; padding: 0px; font-size: 14px; line-height: 1.29; color: rgb(33, 33, 33); font-family: Inter, -apple-system, Helvetica, Arial, sans-serif;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\">Thanks to the HD Ready resolution of this Kodak Linux TV, you can watch all your favourite content with exceptional quality and clarity. The colour accuracy delivered by this TV enables you with true colours and offers an immersive display experience.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\"><br></p><div class=\"_9GQWrZ\" style=\"margin: 0px; padding: 0px 0px 10px; font-size: 20px;\">Immersive Audio</div><div class=\"AoD2-N\" style=\"margin: 0px; padding: 0px; line-height: 1.29;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px;\">The 20 W speakers of this TV offer a theatre-like audio experience in the comfort of your home, so you can watch movies, shows, and games with utmost precision and immersion. You can hear every dialogue from your favourite movies and do not have to miss a beat of your liked songs.</p></div></div>', '<p><span style=\"color: rgb(33, 33, 33); font-family: Inter, -apple-system, Helvetica, Arial, sans-serif; font-size: 14px;\">The Kodak HD Ready LED Smart Linux TV is a game changer with its Mali Quad-cord GPU engine and Amlogic chipset. They deliver exceptional performance and visuals with the help of the HD Ready resolution. The 20 W speakers featured in this TV offers an immersive audio experience so you can enjoy everything the way the creators intend to. You can watch any content you like, thanks to the Miracast feature of this Kodak TV.</span><br></p>', 55, 15, 22999, 13999, 5, 0, 'https://fkrt.co/ZpyJ0y', 'KODAK Special Edition 108 cm (43 inch) Full HD LED Smart Linux TV', ' Full HD LED Smart, KODAK , HD Led tv , flipkart, hostshoppingdeals.in', 'KODAK Special Edition 108 cm (43 inch) Full HD LED Smart Linux TV 2024 Edition with 30W Sound Output & Bezel-Less Design  (43SE5004BL)', 108, '2024-09-18 11:10:56', '2024-09-25 06:38:22', NULL),
(134, 'ZEBRONICS Juke BAR 9750 PRO 5.1.2 Surround Dolby Atmos 525W Soundbar with Subwoofer, Dual Wireless Rear Satellites, HDMI eARC, Optical, Bluetooth 5.0, Wall Mount & Remote Control', '<h1 class=\"a-size-base-plus a-text-bold\" style=\"padding: 0px 0px 4px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-weight: 700 !important; font-size: 16px !important; line-height: 24px !important;\">About this item</h1><ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); padding: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Experience true DOLBY ATMOS with 5.1.2 surround configuration in ZEB-JUKE BAR 9750 PRO.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Enabled with features such as Dual Wireless rear satellites, Dual Top firing drivers &amp; Triple front facing drivers in the soundbar and Deep Bass 6.5\" subwoofer. All contribute to the perfect surround sound experience with DOLBY ATMOS decoding.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">eARC (enhanced ARC) support for smart TVs, also supports regular ARC (backwards compatible) for High data rate transmission for decoding loss less DOLBY ATMOS and other formats DOLBY AUDIO.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">With total 525 Watts output - Soundbar (225W) Subwoofer (150W) Wireless rear satellites (75W x2).</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Driver size configuration - 6.5\" Subwoofer, Triple 2.5\" front facing soundbar drivers, Dual 2\" Top firing soundbar drivers, Dual 2\"x3\" wireless rear satellite drivers.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">The dual top firing drivers in the soundbar provide an immersive audio experience. Feel an elevation in the sound with properly balanced and dynamically positioned output without loss!</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Dual wireless satellites which are powered with a dedicated DC adapter, can be placed up to 8 meters away from the soundbar for the best 5.1.2 surround experience!</span></li></ul>', '<table class=\"a-normal a-spacing-micro\" style=\"width: 453.962px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px; margin-bottom: 0px !important;\"><tbody><tr class=\"a-spacing-small po-brand\" style=\"margin-bottom: 8px !important;\"><td class=\"a-span3\" style=\"vertical-align: top; padding-top: 0px; padding-bottom: 3px; padding-left: 0px; margin-right: 0px; width: 118.838px; float: none !important;\"><span class=\"a-size-base a-text-bold\" style=\"font-weight: 700 !important; line-height: 20px !important;\">Brand</span></td><td class=\"a-span9\" style=\"vertical-align: top; padding-top: 0px; padding-right: 0px; padding-bottom: 3px; margin-right: 0px; width: 335.125px; float: none !important;\"><span class=\"a-size-base po-break-word\" style=\"word-break: break-word; line-height: 20px !important;\">ZEBRONICS</span></td></tr><tr class=\"a-spacing-small po-speakers_maximum_output_power\" style=\"margin-bottom: 8px !important;\"><td class=\"a-span3\" style=\"vertical-align: top; padding-top: 3px; padding-bottom: 3px; padding-left: 0px; margi