(135, 'boAt Aavante Bar 4100DA Bluetooth Soundbar with Dolby Atmos 3D Cinematic Sound,300W RMS Signature Sound', '<h1 class=\"a-size-base-plus a-text-bold\" style=\"padding: 0px 0px 4px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-weight: 700 !important; font-size: 16px !important; line-height: 24px !important;\">About this item</h1><ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); padding: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Dive into an unparalleled auditory adventure with the boAt Aavante Bar 4100DA Bluetooth Soundbar, featuring Dolby Atmos 3D Cinematic Sound that elevates your audio encounters to new dimensions.;Unleash the force of 300W RMS boAt Signature Sound, delivering deep bass and crystal-clear highs that redefine your listening experience.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Enjoy a 3.1.2 Channel setup that envelops you in rich and immersive soundscapes, providing a multi-dimensional feel to your audio.;Connect effortlessly with the soundbar\'s Multi-Connectivity Modes, including AUX, USB, Optical, HDMI, and Coaxial options, ensuring compatibility with a range of devices.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Harness the power of Bluetooth v5.3 to stream music wirelessly from your devices, experiencing freedom without compromise.;Enhance your entertainment with Entertainment EQ Modes such as Music, Movies, News, and 3D, adapting the soundbar\'s output to suit your content.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Elevate your space aesthetically with the soundbar\'s Wall Mountable Design, adding both style and function to your room.; Take charge of your audio journey with the convenience of the Master Remote Control, allowing you to fine-tune your sound without leaving your seat.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">Is Waterproof: False</span></li></ul>', '<p>boAt Aavante Bar 4100DA Bluetooth Soundbar with Dolby Atmos 3D Cinematic Sound,300W RMS Signature Sound,3.1.2 Channel, BT v5.3,Multi-Connectivity&amp;EQ Modes &amp;Remote Control(Premium Black)</p><table class=\"a-normal a-spacing-micro\" style=\"width: 568.987px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px; margin-bottom: 0px !important;\"><tbody><tr class=\"a-spacing-small po-brand\" style=\"margin-bottom: 8px !important;\"><td class=\"a-span3\" style=\"vertical-align: top; padding-top: 0px; padding-bottom: 3px; padding-left: 0px; margin-right: 0px; width: 148.95px; float: none !important;\"><span class=\"a-size-base a-text-bold\" style=\"font-weight: 700 !important; line-height: 20px !important;\">Brand</span></td><td class=\"a-span9\" style=\"vertical-align: top; padding-top: 0px; padding-right: 0px; padding-bottom: 3px; margin-right: 0px; width: 420.038px; float: none !important;\"><span class=\"a-size-base po-break-word\" style=\"word-break: break-word; line-height: 20px !important;\">boAt</span></td></tr><tr class=\"a-spacing-small po-speakers_maximum_output_power\" style=\"margin-bottom: 8px !important;\"><td class=\"a-span3\" style=\"vertical-align: top; padding-top: 3px; padding-bottom: 3px; padding-left: 0px; margin-right: 0px; width: 148.95px; float: none !important;\"><span class=\"a-size-base a-text-bold\" style=