(136, 'ZEBRONICS Haa1020 Hdmi 2.0 Cable - Hdmi Arc Enabled | 18 Gbps | 4K 60Hz | 1080P 240Hz ', '<h1 class=\"a-size-base-plus a-text-bold\" style=\"padding: 0px 0px 4px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-rendering: optimizelegibility; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-weight: 700 !important; font-size: 16px !important; line-height: 24px !important;\">About this item</h1><ul class=\"a-unordered-list a-vertical a-spacing-mini\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 18px; color: rgb(15, 17, 17); padding: 0px; font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px;\"><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">[Seamless connectivity]: The ZEB-HAA 1020 has its 1-meter HDMI A male to A male cable, providing a robust physical connection between compatible devices striking a balance between flexibility and practicality.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">[Aspect ratio]: The ZEB-HAA 1020 enhances cinematic experiences by supporting up to a 21:9 video aspect ratio, maximizing the capabilities of widescreen displays, and delivering stunning visuals.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">[32 Audio Channels]: With support for up to 32 audio channels, you can revel in rich, multidimensional soundscapes that elevate your audio experiences.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">[High-Speed data transfer]: The ZEB-HAA 1020 can support high-speed data transfer rates of up to 18Gbps, facilitating smooth and uninterrupted transmission of high-resolution video, audio, and multimedia content.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">[Compatibility]: The cable has broad compatibility with HDMI-enabled devices. Whether it\'s televisions, displays, A/V receivers, Blu-ray players, computers, PlayStation consoles, or myriad other devices, the ZEB-HAA 1020 seamlessly integrates.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">[Extension Support]: This cable offers enhanced functionality through support for Audio Return Channel (ARC) and Consumer Electronics Control (CEC) extensions. ARC enables streamlined audio transmission between compatible devices, while CEC facilitates convenient control and operation of multiple devices through a single remote</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">[Backward compatibility]: The cable is designed with backward compatibility with earlier HDMI versions. This feature ensures seamless integration with multimedia technology, making the ZEB-HAA 1020 a reliable and enduring solution.</span></li><li class=\"a-spacing-mini\" style=\"list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\">[Resolution support]: The ZEB-HAA 1020 HDMI Cable supports resolutions up to 1080p at a refresh rate of 240Hz and 4K resolution upto 60Hz, providing ultra-smooth and high-definition visuals for an unparalleled viewing experience.</span></li></ul>', '<p>ZEBRONICS Haa1020 Hdmi 2.0 Cable - Hdmi Arc Enabled | 18 Gbps | 4K 60Hz | 1080P 240Hz | Strong &amp; Durable | Supports Up To 32 Audio Channels | 1 Meter, Black</p><table class=\"a-normal a-spacing-micro\" style=\"width: 568.987px; color: rgb(15, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 14px; margin-bottom: 0px !important;\"><tbody><tr class=\"a-spacing-small p